var ImageModel = function (data, parent) {
    var self = this;
    var imageStr =
        "data:image/jpeg;base64,";
    self.Id = ko.observable(data && data.Id ? data.Id : null);

    self.ObjectId = ko.observable(parent && parent.Id ? parent.Id() : null);
    self.ImageName = ko.observable(data && data.ImageName ? data.ImageName : '');
    //self.Image = ko.observable(data && data.ImageBase64Str ? data.ImageBase64Str : null);
    self.Image = ko.observable("Content/User/images/ listing_thumb_1.jpg");
    self.ImageExtension = ko.observable('');
    self.getImageInfo = function (obj) {
        self.ImageName(obj.name);
        var imgType = obj.type.substring(6);
        self.ImageExtension(imgType);
    };
    ImageModel.prototype.toJSON = function () {

        var obj = {
            Id: ko.utils.unwrapObservable(self.Id()),
            ImageName: ko.utils.unwrapObservable(self.ImageName()),
            ImageExtension: ko.utils.unwrapObservable(self.ImageExtension()),
            ObjectId: ko.utils.unwrapObservable(self.ObjectId()),
            ImageBase64Str: ko.utils.unwrapObservable(self.Image())

        };
        return obj;

    };
}